import Upload from "../assets/icons/ui/upload.js";
import Cross from "../assets/icons/ui/cross.js";
import Instagram from "../assets/icons/social/instagram.js";
import Twitter from "../assets/icons/social/twitter.js";
import Google from "../assets/icons/social/google.js";
import Facebook from "../assets/icons/social/facebook.js";
import UserShot from "../layouts/shot_user.js";
import  NavEdit from "../layouts/nav-edit.js";
import  NavEditMobile from "../layouts/nav-edit-mobile.js";

function User() {
  return <img src="images/default/user.jpg" alt="user image" />
}



export default () => (
  <BaseLayout>
  <div id="page">
  <div class='contents bg-grey'>
  <div class='section center-section'>
<h1 class='title'>多種多彩なフィードバックをお待ちしております。</h1>
<p  style={{ marginBottom: 10 }}>私達Ceaperは常にユーザーの方が心地良くサービスを使えるように新しい機能の開発・修正に挑んでいます。Ceaperのサービスを使用する中で、機能について不満に思った事や、ご要望などがございましたら、お気軽にご連絡ください。</p>
<p class="xs-text grey"  style={{ margin: 0 }}>当ページはお問い合わせのフォームではない為、原則ご返信は出来かねます。致命的な機能のバグ・不具合のご報告につきましては、ご返信と共に、早急なご対応をいたします。また返答が必要な質問やサポートが必要な場合は、  <a class="grey border-text xs-text"  target="_blank" rel="nofollow noreferrer noopener" href="mailto: support@ceaper.com">サポート窓口</a>までお問い合わせください。</p>
</div>
 </div>
 <div class='contents'>
 <div class='section center-section'>



</div>
</div>


 </div>
</BaseLayout>
)
